import React from 'react';
import ReactDOM from 'react-dom/client';
import Index from './components/landing/Index2';
//import Kalender from './components/kalender/Kalender';
//import Uebersicht from './components/uebersicht/Uebersicht';
import Filter from './navigation/Filter'
import KalenderContent from './components/kalender/KalenderContent';
import UebersichtContent from './components/uebersicht/UebersichtContent';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import './css/color.css';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <BrowserRouter>
      <Routes>

          <Route path = '/' element = {
            <Index filter = {<></>} content = {
              <><h2 id="welcome">Willkommen beim</h2> <Logo name="bigPic"/></>
            }/>
          } exact/>
          <Route path = '/kalender' element = {
            <Index filter = {
              <Filter updateFilterParent = {this.updateFilter}/>
            } content = {<KalenderContent/>}/>
          } exact/>
          <Route path = '/uebersicht' element = {
            <Index filter = {
              <Filter updateFilterParent = {this.updateFilter}/>
            } content = {<UebersichtContent/>}/>
          } exact/>



      </Routes>
  </BrowserRouter>
);
